"use client";

import { useState } from "react"
import { FormInput } from "./FormInput"
import { FormButton } from "./FormButton"
import { RoleSelect } from "./RoleSelect"
import "./SignupPage.css"

export function SignupPage({ onLoginClick }) {
  const [formData, setFormData] = useState({
    username: "",
    password: "",
    confirmPassword: "",
    role: "User",
  })
  const [errors, setErrors] = useState({})
  const [loading, setLoading] = useState(false)
  const [successMessage, setSuccessMessage] = useState("")

  const validateForm = () => {
    const newErrors = {}
    if (!formData.username.trim()) {
      newErrors.username = "Username is required"
    }
    if (!formData.password.trim()) {
      newErrors.password = "Password is required"
    } else if (formData.password.length < 6) {
      newErrors.password = "Password must be at least 6 characters"
    }
    if (formData.password !== formData.confirmPassword) {
      newErrors.confirmPassword = "Passwords do not match"
    }
    setErrors(newErrors)
    return Object.keys(newErrors).length === 0
  }

  const handleChange = (e) => {
    const { name, value } = e.target
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }))
    if (errors[name]) {
      setErrors((prev) => ({
        ...prev,
        [name]: "",
      }))
    }
  }

  const handleRoleChange = (value) => {
    setFormData((prev) => ({
      ...prev,
      role: value,
    }))
  }

  const handleSubmit = async (e) => {
    e.preventDefault()
    if (!validateForm()) return

    setLoading(true)
    setSuccessMessage("")
    try {
      const response = await fetch("/signup", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          username: formData.username,
          password: formData.password,
          role: formData.role,
        }),
      })

      if (response.ok) {
        setSuccessMessage("Signup successful! Redirecting to login...")
        setTimeout(() => onLoginClick(), 2000)
      } else {
        setErrors({ submit: "Signup failed. Username may already exist." })
      }
    } catch (error) {
      setErrors({ submit: "Network error. Please try again." })
    } finally {
      setLoading(false)
    }
  }

  return (
    <div className="signup-container">
      <div className="signup-background"></div>

      <div className="signup-wrapper">
        <div className="signup-card">
          <h1 className="signup-title">SIGN UP</h1>

          {successMessage && (
            <div className="bg-green-100 text-green-800 p-3 rounded mb-4 text-sm">{successMessage}</div>
          )}
          {errors.submit && <div className="bg-red-100 text-red-800 p-3 rounded mb-4 text-sm">{errors.submit}</div>}

          <form onSubmit={handleSubmit} className="signup-form-space">
            <FormInput
              label="Username"
              name="username"
              type="text"
              placeholder="ex. admin@gmail.com"
              value={formData.username}
              onChange={handleChange}
              error={errors.username}
            />

            <FormInput
              label="Password"
              name="password"
              type="password"
              placeholder="Password (min 6 characters)"
              value={formData.password}
              onChange={handleChange}
              error={errors.password}
            />

            <FormInput
              label="Confirm Password"
              name="confirmPassword"
              type="password"
              placeholder="Confirm Password"
              value={formData.confirmPassword}
              onChange={handleChange}
              error={errors.confirmPassword}
            />

            <RoleSelect value={formData.role} onChange={handleRoleChange} />

            <FormButton type="submit" disabled={loading}>
              {loading ? "Creating account..." : "Create Account"}
            </FormButton>

            <div className="signup-login-link">
              <button type="button" onClick={onLoginClick}>
                Already have an account? Log in
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  )
}
